INSERT INTO regulation (regulation_id, regulation_name, target, pdf_file_path, regulation_description, expire_date, created_by_admin) VALUES
    (N'44E65FA5-A60E-4901-990C-DA941CD18218', N'Quy chế tuyển sinh và đào tạo Thạc sĩ', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Admission_and_Training_Regulations_for_Master''s_Programs.pdf', N'Quy định chi tiết về quy trình tuyển sinh, điều kiện dự tuyển, hình thức đào tạo, chương trình học, thời gian đào tạo, điều kiện tốt nghiệp và cấp bằng cho sinh viên theo học chương trình Thạc sĩ. Bao gồm các quy định về luận văn, hội đồng chấm luận văn, tiêu chuẩn đầu ra và quyền lợi của học viên cao học.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'05526532-20C3-44E0-A38A-3DDDCCD8D5C3', N'Quy chế tuyển sinh và đào tạo Thạc sĩ', N'instructor', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Admission_and_Training_Regulations_for_Master''s_Programs.pdf', N'Quy định chi tiết về quy trình tuyển sinh, điều kiện dự tuyển, hình thức đào tạo, chương trình học, thời gian đào tạo, điều kiện tốt nghiệp và cấp bằng cho sinh viên theo học chương trình Thạc sĩ. Bao gồm các quy định về luận văn, hội đồng chấm luận văn, tiêu chuẩn đầu ra và quyền lợi của học viên cao học.', NULL, N'00000000-0000-0000-0000-000000000023'),
    (N'F11C8292-0A53-4CB0-80F3-56ECCFFC5B99', N'Quy định sử dụng cơ sở vật chất', N'student', N'https://baygtczqmdoolsvkxgpr.supabase.co/storage/v1/object/public/regulations/Regulations_on_the_Use_of_Facilities.pdf', N'Quy định về việc sử dụng và quản lý các cơ sở vật chất của trường bao gồm phòng học, giảng đường, thư viện, phòng thí nghiệm, phòng máy tính, khu thể thao, ký túc xá. Hướng dẫn đăng ký sử dụng, quy tắc ứng xử, bảo quản tài sản, xử lý vi phạm và trách nhiệm của sinh viên khi sử dụng các tiện ích chung của nhà trường.', NULL, N'00000000-0000-0000-0000-000000000023'),
